static unsigned int unknown_version(unsigned int ntsyscall)
{
    return INVALID_SYSCALL;
}


struct version
{
    DWORD major;
    DWORD minor;
    DWORD build;
    unsigned int (*map_function)(unsigned int);
} versions[] = {
    {6,0,6000,win6_0_6000},
    {6,0,6001,win6_0_6001},
    {6,0,6002,win6_0_6002},
    {6,1,7600,win6_1_7600},
    {6,1,7601,win6_1_7601},
    {6,2,9200,win6_2_9200},
    {6,3,9600,win6_3_9600},
    {10,0,10240,win10_0_10240},
    {10,0,10586,win10_0_10586},
    {10,0,14393,win10_0_14393},
    {10,0,15063,win10_0_15063},
    {10,0,16299,win10_0_16299},
    {10,0,17134,win10_0_17134},
    {10,0,17763,win10_0_17763},
    {10,0,18362,win10_0_18362},
    {10,0,18363,win10_0_18363},
    {10,0,19041,win10_0_19041},
};

static void determine_version(void)
{
    unsigned int i;
    RTL_OSVERSIONINFOEXW info;

    RtlGetVersion(&info);
    for (i = 0; i < ARRAY_SIZE(versions); i++)
    {
        if ((info.dwMajorVersion == versions[i].major) &&
            (info.dwMinorVersion == versions[i].minor) &&
            (info.dwBuildNumber == versions[i].build))
        {
            map_function = versions[i].map_function;
            return;
        }
    }

    FIXME("No NT syscall mapping table for version %d.%d.%d",
          info.dwMajorVersion, info.dwMinorVersion, info.dwBuildNumber);
    map_function = unknown_version;
}

unsigned int __wine_syscall_nr_from_nt(unsigned int ntsyscall)
{
    unsigned int ret;

    pthread_once(&check_version_once, determine_version);

    ret = map_function(ntsyscall);
    if (ret == INVALID_SYSCALL)
        FIXME("Unknown NT syscall number %u\n", ntsyscall);

    return ret;
}

